import React, { Component } from 'react';
import ProductDetail from './ProductDetail';
import './ProductList.css'

function ProductsList(products, handleProductSelect) {
 
return (
    <div>
        <table className='product-table'>
                {products.map(product => <ProductDetail key={product.id} name = {product.name} description = {product.description} price = {product.price} handleProductSelect = {handleProductSelect}></ProductDetail>)}          
        </table>
    </div>
                )
                }

export default ProductsList;
